import TanamanCard from "../components/TanamanCard";

const dummyTanaman = [
  {
    id: 1,
    nama: "Monstera",
    jenis: "Daun Hias",
    lokasi: "Ruang Tamu",
  },
  {
    id: 2,
    nama: "Lidah Mertua",
    jenis: "Indoor",
    lokasi: "Kamar",
  },
];

const Tanaman = () => {
  return (
    <div className="p-6">
      <div className="flex justify-between items-center mb-6">
        <h1 className="text-2xl font-bold text-green-800">Daftar Tanaman</h1>
        <button className="bg-green-600 hover:bg-green-700 text-white px-4 py-2 rounded">
          + Tambah Tanaman
        </button>
      </div>

      <div className="grid gap-4 md:grid-cols-2 lg:grid-cols-3">
        {dummyTanaman.map((tanaman) => (
          <TanamanCard key={tanaman.id} tanaman={tanaman} />
        ))}
      </div>
    </div>
  );
};

export default Tanaman;
